import React, { Component } from 'react';
import TopNav from '../TopNav/TopNav';
import CountdownTimer from '../CountdownTimer/CountdownTimer';
import BottomNav from '../BottomNav/BottomNav';
import Particles from 'react-particles-js';

import soldier from '../../assets/soldier.png';
import './App.scss';

class App extends Component {
  render() {
    return (
      <div className="App">
        <TopNav />
        <CountdownTimer />
        <BottomNav />
        <Particles
        params={{
          "particles": {
            "number": {
              "value": 160,
              "density": {
                "enable": false
              }
            },
            "size": {
              "value": 5,
              "random": true
            },
            "move": {
              "direction": "bottom",
              "out_mode": "out",
              "speed": 12
            },
            "line_linked": {
              "enable": false
            }
          },
          "interactivity": {
            "events": {
              "onclick": {
                "enable": true,
                "mode": "remove"
              }
            },
            "modes": {
              "remove": {
                "particles_nb": 10
              }
            }
          }
        }} style={{
          height: '99vh',
          position: 'absolute',
          top: '-2rem'
        }}/>
        {/* }<img className="character-img" src={soldier} alt="Sora" /> */}
      </div>
    );
  }
}

export default App;
